import React from "react";
import Navbar from "./Navbar";
import Logo from "./Logo";
import Footer from "./Footer";

const Login = () => {
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
        padding: 0,
      }}
    >
      <Navbar />
      <Logo />
      <p>Нэвтрэх</p>
      <div>
        <div className="">
          <p>Цахим хаяг</p>
          <input placeholder="name@mail.domain" />
        </div>
        <div className="">
          <p>Нууц үг</p>
          <input placeholder="••••••••••" />
        </div>
        <div className="">
          <div className="">
            <input type="checkbox" />
            <p>Намайг сана</p>
          </div>
          <p></p>
        </div>
        <button>Нэвтрэх</button>
        <p>Шинэ хэрэглэгч бол энд дарна уу?</p>
      </div>

      <Footer />
    </div>
  );
};
export default Login;
